import React from "react";
import './sample.css';
import web from '../mac.jpg'






const contacts = [
  {
    id: 1,
    name: "Nora",
    imgURL:
      "https://static.toiimg.com/photo/msid-87698129/87698129.jpg?62448",
    p: "+123 456 789",
    email: "b@beyonce.com"
    
  },
 
  {
    id: 3,
    name: "yaswith",
    imgURL:
      "https://i.pinimg.com/originals/e3/94/47/e39447de921955826b1e498ccf9a39af.png",
    p: "+918 372 574",
    email: "gmail@chucknorris.com"
  },

  {
    id: 3,
    name: "yaswith",
    imgURL:
      "https://i.pinimg.com/originals/e3/94/47/e39447de921955826b1e498ccf9a39af.png",
    p: "+918 372 574",
    email: "gmail@chucknorris.com"
  },

  {
    id: 3,
    name: "yaswith",
    imgURL:
      "https://i.pinimg.com/originals/e3/94/47/e39447de921955826b1e498ccf9a39af.png",
    p: "+918 372 574",
    email: "gmail@chucknorris.com"
  },
  {
    id: 3,
    name: "yaswith",
    imgURL:
      "https://i.pinimg.com/originals/e3/94/47/e39447de921955826b1e498ccf9a39af.png",
    p: "+918 372 574",
    email: "gmail@chucknorris.com"
  }
];

function CreateCard(contact) {
  return (
    <Cardvote
      key={contact.id}
      name={contact.name}
      img={contact.imgURL}
      tel={contact.phone}
      email={contact.email}
    />
  );
}
function Vt() {
  return (
    <div>
      <h1 className="heading">Partic</h1>
      {contacts.map(CreateCard)}

  
    </div>
  );
}



function Cardvote(props) {
  return (
    <div className="card">
      <div className="top">
        <h2 className="name">{props.name}</h2>
        <Avatar img={props.img} />
      </div>
      <div className="bottom">
        <Detail detailInfo={props.tel} />
        <Detail detailInfo={props.email} />
      </div>
    </div>
  );
}

function Avatar(props) {
  return <img className="circle-img" src={props.img} alt="avatar_img" />;
}

function Detail(props) {
  return <p className="info">{props.detailInfo}</p>;
}

function Card(props) {
  return (
    <div style={{paddingRight:'10px' }} class="w3-col l4 m6 w3-margin-bottom">
    <div class="w3-card">
        <img src={web} alt="John" style={{width:"100%"}} />
        <div class="w3-container">
            <h4>{props.name}</h4>
            <p class="w3-opacity">////</p>
            <p>{props.p}</p>
            <p><button class="w3-button w3-light-grey w3-block"><i class="fa fa-envelope"></i> Contact</button></p>
        </div>
    </div>
</div>
  );
}




function createCard(contact) {
  return (
    <Card
    
      name={contact.name}
      p={contact.p}
      
    />
  );
}


function Ei() {
  return (
    <div >

      {contacts.map(createCard)}
      

    </div>
  );
}

export default Ei
export {Vt}
